import React, { useState, useEffect } from "react";
import axios from "axios";

const API_URL = "http://localhost:1212/api";

const App = () => {
  const [token, setToken] = useState(localStorage.getItem("token") || "");
  const [flights, setFlights] = useState([]);
  const [wallet, setWallet] = useState(null);
  const [user, setUser] = useState(null);
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [userId, setUserId] = useState(null);

  const login = async () => {
    try {
      const res = await axios.post(`${API_URL}/login`, {
        userEmail: email,
        userPassword: password,
      });
      const jwt = res.data?.token || res.data;
      const userInfo = res.data?.user || null;
      setToken(jwt);
      localStorage.setItem("token", jwt);
      if (userInfo) {
        setUser(userInfo);
        setUserId(userInfo.userId);
      }
    } catch (err) {
      alert("Login failed");
    }
  };

  const logout = () => {
    setToken("");
    localStorage.removeItem("token");
    setUser(null);
    setWallet(null);
  };

  const fetchFlights = async () => {
    try {
      const res = await axios.get(`${API_URL}/flights`, {
        headers: { Authorization: `Bearer ${token}` },
      });
      setFlights(res.data);
    } catch (err) {
      console.error("Failed to fetch flights", err);
    }
  };

  const fetchWallet = async () => {
    if (!userId) return;
    try {
      const res = await axios.get(`${API_URL}/wallets/${userId}`, {
        headers: { Authorization: `Bearer ${token}` },
      });
      setWallet(res.data);
    } catch (err) {
      console.error("Failed to fetch wallet", err);
    }
  };

  const bookFlight = async (flightId) => {
    try {
      await axios.post(
        `${API_URL}/bookings`,
        { userId, flightId },
        { headers: { Authorization: `Bearer ${token}` } }
      );
      alert("Flight booked successfully");
    } catch (err) {
      alert("Booking failed");
    }
  };

  const topUpWallet = async (amount) => {
    try {
      await axios.post(
        `${API_URL}/wallets/topup`,
        { userId, amount },
        { headers: { Authorization: `Bearer ${token}` } }
      );
      fetchWallet();
      alert("Wallet topped up");
    } catch (err) {
      alert("Top-up failed");
    }
  };

  useEffect(() => {
    if (token) {
      fetchFlights();
    }
  }, [token]);

  return (
    <div style={{ padding: 20 }}>
      <h1>Flight Booking Frontend</h1>
      {!token ? (
        <div>
          <input
            placeholder="Email"
            value={email}
            onChange={(e) => setEmail(e.target.value)}
          />
          <input
            type="password"
            placeholder="Password"
            value={password}
            onChange={(e) => setPassword(e.target.value)}
          />
          <button onClick={login}>Login</button>
        </div>
      ) : (
        <div>
          <button onClick={logout}>Logout</button>

          <h2>Flights</h2>
          <ul>
            {flights.map((flight) => (
              <li key={flight.flightId}>
                {flight.flightNumber} - {flight.source} to {flight.destination} on {flight.departureDate}
                <button onClick={() => bookFlight(flight.flightId)} style={{ marginLeft: 10 }}>Book</button>
              </li>
            ))}
          </ul>

          <h2>Wallet</h2>
          {wallet ? (
            <p>Balance: ${wallet.balance}</p>
          ) : (
            <button onClick={fetchWallet}>Load Wallet</button>
          )}
          <div>
            <button onClick={() => topUpWallet(100)}>Top Up $100</button>
          </div>
        </div>
      )}
    </div>
  );
};

export default App;
